        .associate { (restaurantUuid, restaurant) ->
            val tables = (1..10)
                .map {
                    if (restaurant.name == "Ristorante La Cucoma" && it == 7)
                        Table(it.toString(), Uuid.parseHex("2113970d34134d3c9aeea5568d1a8483"))
                    else
                        Table(it.toString())
                }
                .associateBy { it.uuid }
            restaurantUuid to tables
        }

